const honeyTypes = ['akác', 'gyógy', 'hárs', 'virág', 'repce'];

function List() {
    return (
      <div>
        <h1>Elérhető mézfajták:</h1>
        <ul>
          {honeyTypes.map((type) => (
            <li key={type}>{type}</li>
          ))}
        </ul>
      </div>
    );
  }

  export default List;
